import React, { Component } from "react";
import Exercises from "./Exercises";
import Selection from "./Selection";

const HomePage = (props) => {
    const workoutSelect = (exercise) => {
      setState((prevState) => ({
          selectedWorkouts: [...prevState.selectedWorkouts, exercise],
      }));
    };
    const { workouts, selectedWorkouts, workoutDeselect} = props;
    return (
      <div>
        <div className="container-fluid">
          <div className="row justify-content-center">
            <Exercises 
              workouts={workouts} 
              workoutSelect={workoutSelect}
              workoutDeselect={workoutDeselect}
              selectedWorkouts={selectedWorkouts}
            />
            <Selection
              selectedWorkouts={selectedWorkouts}
              workoutDeselect={workoutDeselect}
            />            
          </div>
          <div className="row justify-content-center">
                <button className="btn btn-success bottom-margin">Start!</button>
          </div>
        </div>
      </div>
    );
  }

export default HomePage;
